he \r\n\r\n<h1>Institute are:</h1>", "blog_image": "blog_image/Screenshot_44.png", "slug": "first-blog", "published": "2021-08-31", "hit_count": 2}}, {"model": "ssf.blogpost", "pk": 2, "fields": {"title": "<p style=\"color:red;\">This Is Second blog</p>", "description": "The unique history, collections and research of the Kinsey Institute have established it as a leader internationally in scholarship, teaching and service in sexuality, gender and reproduction. The Institutes mission is to maintain this leadership by developing and nurturing a community of interdisciplinary scholarship within and beyond Indiana University. This community of scholarship includes the arts, humanities, social sciences, natural sciences, medicine, education and law. The primary intellectual and research concerns of the Institute are:", "blog_image": "blog_image/Screenshot_16.png", "slug": "send-blog", "published": "2021-08-31", "hit_count": 0}}, {"model": "ssf.blogpost", "pk": 3, "fields": {"title": "tist-is This is third test blog", "description": "test blog", "blog_image": "blog_image/SamplePNGImage_3mbmb.png", "slug": "this-is-third-blog", "published": "2022-02-04", "hit_count": 0}}, {"model": "ssf.blogpost", "pk": 4, "fields": {"title": "What It's Like Being Married to Someone Who Has Herpes: Interview with Bill Gaylord", "description": "This was such a fun interview to do because I got to interview my favorite person in the world, my husband. Bill comes on the show and talks about his experience of what its like to marry someone with herpes. We get into what it was like when I disclosed to him, what it was like when we were dating, and then now what its like being married. Many people confront problems with herpes and have partners suffering from herpes. Here, our talk will help you look into how it is to be married to someone who has herpes.\r\n\r\n\r\nI have Bill share his initial reaction to when I disclosed it. He talks about how he really didnt know anything about herpes and wanted to learn more about it. His number one concern was does herpes shorten his life? And this is something that believes it or not, I come across a ton in DMs or questions in the Secret Society. It is one of the questions or issues with a partner suffering from herpes. People often confuse HSV with HIV and think that herpes is deadly. Just to clarify...HSV and HIV are two completely different viruses and herpes will not kill you, impact your health in any way nor will it shorten your life. All that herpes is is a skin disease. And there is nothing wrong with having sex with a partner suffering from herpes.\r\n\r\n\r\nOne of the things I was curious about especially talking to someone who doesnt have herpes was what was the stigma like for Bill?  He said that he knew about the stigma but his main question was how does the herpes virus impact his life. He wanted to know that it really doesnt play a part in his life other than a possible bump here or there.  Bill just says that the stigma is far worse than what herpes really is and it should not impact you falling in love, having sex with a partner suffering from herpes, or deciding to marry someone.  \r\n\r\n\r\nOne of the things that we think is positive is because I get outbreaks I have to communicate to Bill whats going on with my body. So in other words, we communicate about my outbreaks or lack thereof. If I have an outbreak, it doesnt keep us from getting intimate. It just requires us to find other ways to have sex. Sex doesnt have to mean traditional sex there are so many other ways to find intimacy and have fun. Thus, there is nothing wrong with having sex with a partner suffering from herpes. So what if I have an outbreak? \r\n\r\nOh and just to clarify, Bill gets tested at least once a year if not twice a year and he still does not have HSV 1 or HSV 2. Why that is, well maybe it's because I dont shed often or maybe some people just dont get it. Honestly, well never know until we know. But for now, hes herpes-free. Lucky Doll...lol.\r\n\r\nIt shows that there won't be any issues with a partner suffering from herpes if you are both understanding and supporting each other.\r\n\r\nOne of the things that we, people with herpes, are self-conscious about are if were looked at differently once we disclose. Like we have HERPES written on our forehead and that our partner will feel differently towards us or look at us differently. So I asked Bill if he looked at me differently once I told him I had herpes. Bill said that absolutely not and what he appreciated was that I was upfront and direct. He appreciated that I told him how I contracted it when I contracted it, and what I was doing to prevent transmission as well as statistics and other medical information. That was really all he cared about. Not the fact that the person he was in love with had herpes. It depicts that there is nothing wrong with having a partner suffering from herpes.", "blog_image": "blog_image/brooke-cagle-oMtXGNw4ZEs-unsplash-scaled.webp", "slug": "What-Its-Like-Being-Married-to-Someone-Who-Has-Herpes-Interview-with-Bill-Gaylord", "published": "2022-02-04", "hit_count": 0}}, {"model": "ssf.videocategory", "pk": 1, "fields": {"slug": "Education", "category_name": "Education"}}, {"model": "ssf.videocategory", "pk": 2, "fields": {"slug": "Research", "category_name": "Research"}}, {"model": "ssf.videocategory", "pk": 3, "fields": {"slug": "Therapy", "category_name": "Therapy"}}, {"model": "ssf.videosubcategory", "pk": 1, "fields": {"slug": "Advertising-Sexuality", "sub_cat": 1, "subcategory_name": "Advertising/Sexuality"}}, {"model": "ssf.videosubcategory", "pk": 2, "fields": {"slug": "Bisexuality", "sub_cat": 1, "subcategory_name": "Bisexuality"}}, {"model": "ssf.videosubcategory", "pk": 3, "fields": {"slug": "Dr-Ruth-Westheimer", "sub_cat": 1, "subcategory_name": "Dr Ruth Westheimer"}}, {"model": "ssf.videosubcategory", "pk": 4, "fields": {"slug": "Gender-Identity", "sub_cat": 1, "subcategory_name": "Gende