, thus creating a more feminine figure and appearance.", "keywords": "vaginoplasty gender reassignment", "duration": 313.0, "record_date": "01 Dec 2015", "country": "Netherlands", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_29-Sep-21-19_29.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_29-Sep-21-19_29.jpg", "created_at": "2021-09-29T17:29:32.078Z", "modified_at": "2021-09-29T17:29:32.078Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 63, "fields": {"user": null, "vendor_id": 0, "title": "Transgender Rap", "video": "uploads/VideoUpload/_04-Oct-21-14_42.mp4", "slug": "Transgender-Rap", "video_cat": 1, "sub_cat": 11, "poster_image": "uploads/poster/_04-Oct-21-14_42.jpg", "desc": "From the Huffington Post:\r\n\r\nIt looks like we just found our new pint-size hero.\r\n\r\nAlex hasn't even left elementary school but he already has a firm grasp on his identity and what it means to be transgender. He wrote a rap about coming out to his mother and shared it on stage at Camp Aranutiq, a camp for transgender and gender-variant youth.\r\n\r\nAccording to its website, Camp Aranu'tiq focuses on, \"building confidence, resilience, and community for transgender and gender-variant youth and their families through camp experiences.\"\r\n\r\nWe're absolutely in love with this kid. Check out the video bto see the rap or read the lyrics below.\r\n\r\nSo I had a little story I'd like to share / about something I went through that might seem pretty weird / Please try and imagine if this was you / or you might have something that you can relate it to / So I was just a little kid about 7 or 8 / and I had something to say that could no longer wait / So I went to my mom that hot day in July / with a hope in my heart and a tear in my eye / Basically I said this girl is your son / and Ive always felt this way and it hasnt 