 On It's On\"", "video": "uploads/VideoUpload/_04-Oct-21-15_20.mp4", "slug": "When-its-On-Its-On", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_04-Oct-21-15_20.jpg", "desc": "The Film titled When it's on it's on was done by Havas Worldwide London advertising agency for Durex in United Kingdom.", "keywords": "condom", "duration": 141.0, "record_date": "1 Oct 2015", "country": "UK", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "Havas Worldwide, London, UK", "director": "Mark Fairbanks", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-15_20.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-15_20.jpg", "created_at": "2021-10-04T13:20:49.035Z", "modified_at": "2021-10-04T13:20:49.035Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 69, "fields": {"user": null, "vendor_id": 0, "title": "Italy - \"Pregnancy test for men: The Prototype\"", "video": "uploads/VideoUpload/_04-Oct-21-15_23.mp4", "slug": "Pregnancy-test-for-men", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_04-Oct-21-15_23.jpg", "desc": "The Film titled Pregnancy test for men  The Prototype was done by DLV BBDO Milan,", "keywords": "Pregnancy Test", "duration": 90.0, "record_date": "01 Apr 2017", "country": "Italy", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "Alessandro Pancotti", "director": "Matteo Masin", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-15_23.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-15_23.jpg", "created_at": "2021-10-04T13:23:41.766Z", "modified_at": "2021-10-04T13:23:41.766Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 70, "fields": {"user": null, "vendor_id": 0, "title": "Sweden - \"Tatelicious\"", "video": "uploads/VideoUpload/_04-Oct-21-15_39.mp4", "slug": "Sweden-Tatelicious", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_04-Oct-21-15_39.jpg", "desc": "In Sweden, no one is deported because of HIV. But people in 22 countries around the world are. So it isnt so surprising that 40 % of refugees in Sweden are reluctant to take an HIV test. This is why RFSL Dalarna and HIV-Sweden decided to launch the second year of the initiative We Are Survivors. We wanted refugees to feel empowered, safe and to trust the Swedish system. And to encourage them to take an HIV test and to not let HIV stop their dreams, because with treatment you can live a normal life with HIV today. Tatelicious is living proof that you are not deported because of HIV and that you can live a good life with dreams and hopes for the future. So we let her tell her powerful story.", "keywords": "HIV", "duration": 145.0, "record_date": "1 Oct 2016", "country": "Sweden", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "Carl Sander", "director": "Marcus Storm", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-15_39.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-15_39.jpg", "created_at": "2021-10-04T13:39:55.292Z", "modified_at": "2021-10-04T13:39:55.292Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 71, "fields": {"user": null, "vendor_id": 0, "title": "Turkey - \"Gay Turtle\"", "video": "uploads/VideoUpload/_04-Oct-21-15_47.mp4", "slug": "Turkey-Gay-Turtle", "video_cat": 1, "sub_cat": 29, "poster_image": "uploads/poster/_04-Oct-21-15_47.jpg", "desc": "We wanted to demonstrate the quick transition between admiring something very cute and feeling uncomfortable perhaps threatened by the idea that it could be gay. So, we chose turtles, so cute and innocent, to be our heroes in rubbing peoples prejudices in their faces.Creative Execution:The film was shot with 8 hidden cameras in an aquarium shop. The unaware turtle shoppers were told by the clerk that the turtle they just picked was gay. The reactions of people -right when they were admiring the cute creature- manifested the prejudice toward gays and LGBTIs in general. The resulting video was released on the official social channels of Amnesty International Turkey.Results:Our campaign was a quick hit on social media with participation of hundred thousands of people including journalists, celebrities and politicians. In just three hours, #gayturtle became a countrywide trending topic on Twitter and covered in prime time national news on its first day.In just 5 days, the campaign obtained 167,924,000 earned media impressions worldwide, with no media budget. It was covered in more than 120 different news and media outlets globally and generated more than $1.7 Million worth of earned media value.Gay Turtle ended up being the most effective campaign that was ever done by Amnesty International in Turkey with more than 35000% increase in online engagement scores vs. their yearlong average. As a result, the number of Amnesty International Turkey online supporters increased by 12% in 7 days.And for the first time, homophobia became a discussion topic in Turkeys history.The conservative shift in Turkey made it nearly impossible to represent LGBTI people in mainstream media and marketing communications because of censorship policies.With #gayturtle, we aimed to bypass this barrier and reach people directly with organic growth. By bringing so many voices together on our side, we made the subject visible on the mass media again and gave voice that LGBTI people have deserved for ages.Homophobia is something so strong that it can make a person hate someone even if the only information they have is about their sexual orientation. It can make them quickly choose to hate even the ones they loved the most. We chose to base our creative route on this fact to deliver our message at the most basic level.As studies showed that the rates of homophobia were extremely high, we had to target the whole nation regardless from the age, location or gender. In order to make people question their perceptions for the first time, we decided to use the power of surprise to underline how pointless is to discriminate simply anything. Homophobia was an absurd thing in itself and people had to face this truth in an undeniably absurd way. This helped us both provoke thought and increase the contagiousness of the idea on social platforms.", "keywords": "sexual orientation", "duration": 136.0, "record_date": "01 SEP 2016", "country": "Turkey", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "Anima stanbul", "director": "Aytug Ungor", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-15_47.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-15_47.jpg", "created_at": "2021-10-04T13:47:05.877Z", "modified_at": "2021-11-21T18:46:51.971Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 72, "fields": {"user": null, "vendor_id": 0, "title": "SSSS 60th Anniversary (1957 - 2017)", "video": "uploads/VideoUpload/_04-Oct-21-16_02.mp4", "slug": "SSSS-60th-Anniversary", "video_cat": 2, "sub_cat": 42, "poster_image": "uploads/poster/_04-Oct-21-16_02.jpg", "desc": "The 60th Anniversary Video shot in Atlanta on November 10, 2017.\r\nI'd like to thank the many people in SSSS who helped make this video happen and Darrin Still at Moorehouse School of Medicine.\r\nThe video is dedicated to the memory of one of our distinguished members, John Delos DeLameter, Ph.D. (1940 - 2017).\r\nBecome a member. \r\nVisit: www.sexscience.org", "keywords": "SSSS 60th Anniversary", "duration": 709.0, "record_date": "10 Nov 2017", "country": "USA", "hit_count": 100, "rated_by": 5, "rating": 0.0, "producer": "Mark Schoen", "director": "Mark Schoen", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-16_02.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/post