ad", "pk": 75, "fields": {"user": null, "vendor_id": 0, "title": "Canada - \"Sam, the first educational transgender toy\"", "video": "uploads/VideoUpload/_04-Oct-21-16_27.mp4", "slug": "Sam-the-first-educational-transgender-toy", "video_cat": 1, "sub_cat": 9, "poster_image": "uploads/poster/_04-Oct-21-16_27.jpg", "desc": "Despite the media buzz regarding transgender rights in recent months, few resources exist to improve the situation for transgender youth today. Gender Creative Kids Canada, together with lg2 is proud to launch The You Inside Project. This is a creative and innovative social project featuring a short animated film shared on social media and an educational toy (a fictional character named Sam) that is for pre-sale on Kickstarter. The project is designed to answer the needs of loved ones searching for tools to discuss this delicate, complex and universal issue with transgender children, their family and friends.", "keywords": "transgender", "duration": 158.0, "record_date": "01 July 2017", "country": "Canada", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Claudia Lemire", "director": "Marc Fortin", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-16_27.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-16_27.jpg", "created_at": "2021-10-04T14:27:16.578Z", "modified_at": "2021-10-04T14:27:30.104Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 76, "fields": {"user": null, "vendor_id": 0, "title": "USA - \"Places of Intimacy\"", "video": "uploads/VideoUpload/_04-Oct-21-16_29.mp4", "slug": "USA-Places-of-Intimacy", "video_cat": 1, "sub_cat": 27, "poster_image": "uploads/poster/_04-Oct-21-16_29.jpg", "desc": "This is the invitation that opens the new film created by Sid Lee Paris, released this week by SKYN for TV and cinema.SKYN brings a unique perspective to a market which communicates largely around safety and functionality. Its through owning this space and creating meaningful conversations within it that we hope to make SKYN not just a condom choice, but a larger lifestyle choice. (Jeyan Heper, President and General Manager Sexual Wellness Global Business Unit, Ansell). Through its FEEL EVERYTHING platform, SKYN hones in on sensation and authenticity to introduce a new way of talking about sex. The brand speaks to a target they call Serial Monogamists- millenials who seek intimacy as a means of forming deeper human connection. The campaign focuses in on different moments of intimacy, based on an insight that intimate memories are intrisically tied to the places in which they were formed. The spot for the premium condom brand then goes on to name places where love can be found. Physical places with hot and heavy erotic potential, like a bedroom for making love or an office conference room Unexpected places like a telephone booth or a store... Places that may even be a bit uncomfortable, like an itchy rug or rough grass. Or even metaphorical places, like a smile or a glance. While encouraging people to build intimacy with their partners, the film - directed by the duo Truman & Cooper (Wanda Productions) - relays an important message of openness, in spirit and in freedom. In a context in which our freedoms are still questioned, its important to remember that love doesnt have to be attached to stereotypes (Cline and Clment Mornet Landa- Creative Directors, Sid Lee Paris). Places of Intimacy also looks to aesthically advocate the sensual universe that the brand promises. We werent looking to show exaggerated nudity, but rather to play with material, skin, and sensation to enhance the product benefits explains Sylvain Thirache (ECD, Sid Lee Paris). Its not about superfluous provocation, but rather a reminder that love can be found anywhere amongst straight, gay, or mixed couples. Its up to each of us to make the most out of this freedom to love.", "keywords": "condoms", "duration": 45.0, "record_date": "01 Apr 2017", "country": "US, France, Italy, Brazil, Poland, Australia, United Kingdom", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Nicolas Lasjaunias", "director": "John Cooper, Truman", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-16_29.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-16_29.jpg", "created_at": "2021-10-04T14:29:43.301Z", "modified_at": "2021-10-04T14:29:43.301Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 77, "fields": {"user": null, "vendor_id": 0, "title": "Germany - \"Studies on Hysteria\"", "video": "uploads/VideoUpload/_04-Oct-21-16_32.mp4", "slug": "Germany-Studies-on-Hysteria", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_04-Oct-21-16_32.jpg", "desc": "The Film titled Studies on Hysteria was done by Filmakademie Baden-Wrttemberg advertising agency for Colorado Denim in Germany.", "keywords": "Nudity", "duration": 467.0, "record_date": "01 Nov 2013", "country": "Germany", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Felix Ruple", "director": "Matthias Buerle, Gabriel Borgetto, Bernd Faa", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_04-Oct-21-16_32.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_04-Oct-21-16_32.jpg", "created_at": "2021-10-04T14:32:47.459Z", "modified_at": "2021-10-04T14:32:47.459Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 78, "fields": {"user": null, "vendor_id": 0, "title": "Finland - \"Angry AIDS, 2\"", "video": "uploads/VideoUpload/_05-Oct-21-09_36.mp4", "slug": "Finland-Angry-AIDS-2", "video_cat": 1, "sub_cat": 30, "poster_image": "uploads/poster/_05-Oct-21-09_36.jpg", "desc": "Angry AIDS is back with some helpful holiday tips! What are you going to give your loved ones this Christmas?", "keywords": "HIV AIDS", "duration": 92.0, "record_date": "01 Dec 2017", "country": "Finland", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "dynamo&son Helsinki", "director": "Juuso Helander", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-09_36.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-09_36.jpg", "created_at": "2021-10-05T07:36:29.439Z", "modified_at": "2021-10-05T07:36:29.439Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 79, "fields": {"user": null, "vendor_id": 0, "title": "Germany - \"Open Your Eyes \"", "video": "uploads/VideoUpload/_05-Oct-21-09_42.mp4", "slug": "Germany-Open-Your-Eyes", "video_cat": 1, "sub_cat": 33, "poster_image": "uploads/poster/_05-Oct-21-09_42.jpg", "desc": "Situation FGM  Female genital mutilation is still an issue. Every 11 seconds a girl is affected somewhere in the world. Even in developed countries like Germany 50000 women and girls are affected by this.Brief We were asked to raise awareness for this terrible abuse of human rights. The brief was to create an attention-grabbing campaign to educate the public about this cause and raise money for the fight against FGM.ObjectivesThe objectives were to open the eyes of the public to this cruel ritual, make people aware of the problem and to raise money to educate change agents.BudgetThis is a zero budget project. Everyone participated for free to make the campaign happen  the agency, the photographer, the film production, famous supporters and all the guys behind and in front of the cameras.Project scale and volume When we submitted the campaign, it just started with print, posters and in socialCampaign Description:Too many people ignore the fact that FGM is still happening, and that the number of victims in Europe and the US is rising. So we wanted to create a visually strong idea, that asks people to open their eyes to this cause. But most of us are tired of being confronted with shocking pictures, such as suffering children. Not to mention, the affected women dont want to be portrayed as victims any longer. So we had to find a stronger solution. The idea:We took close-up photos of the squinted eyes of women affected by FGM. By tilting the picture by 90 degrees the squinted eye with intermeshed eyelashes looks like a cut female genital. In this way, the viewer needs to take a second look to realize what they are looking at. The key visual was also used in films and gifs, where the eyes opened after a fewOutcome:Value added to brandInstead of using stereotypical shocking pictures, we found a new creative way to draw attention to this terrible abuse of human rights. The brand benefited from this by getting a large number of new supporters and donators.Value for consumerThe good feeling to be part of a good cause and to warn children of the future of FGM. Reach/cultural impactDue to the stream of refugees to Europe, Germany alone has 50000 women and girls are threatened, FGM became more and more a real problem in the western world. This is where the campaign begins.SalesToo short to judge.Achievement against briefThe surprising key visual of the tilted Eye impressed people and media in various ways  it went so far that some media didnt allow to publish the campaign.Other KPIs-Execution:Design elements and their integrationA strong key visual  closed eyes, tilted by 90 degrees  that look like a mutilated vagina. Combined with the message Open Your Eyes it powered a strong movement to fight FGM.Design touch pointsThe campaign was published in print, as posters and in social media.Materials, style elements, design choicesThe key visual was present in all chosen design elements  print ads, posters, microsite, Facebook and Instagram posts.Design development and processDuring the design development we realized, that not every eye was suitable to get that striking visual effect. So we had to shoot many affected women to find the perfect range of motives.ScaleA4 and CitylightStrategy:TERRES DES FEMMES is a non-profit women's rights organization.They strive for international networking with other women's rights organizations, support women in consulting and support projects, organizations and initiatives by women for women from abroad. The campaign Open Your Eyes clearly strengthens the organization in its fight against FGM, helps threatened women and girls with advice, and shows supporters how to help.The key visual  a closed womans eye, tilted by 90 degrees  was created by actual victims as well as the wider online community, who produced and posted their own selfie eye-visuals. Emotional interview videos shared the story of the threatened women.Men and women of all ages, who are willing to donate money and to show support by positing the images.We developed visuals that created awareness through their surprising looks. The two images in one idea, brought the message across in a powerful way.", "keywords": "FGM  Female genital mutilation", "duration": 114.0, "record_date": "01 Jan 2017", "country": "Germany", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Nubornpictures", "director": "Martin Venn, Alexandros Antoniadis", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-09_42.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-09_42.jpg", "created_at": "2021-10-05T07:42:26.831Z", "modified_at": "2021-10-05T07:42:26.831Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 80, "fields": {"user": null, "vendor_id": 0, "title": "New Zealand - \"Harmony Freebush Talks Vaginas", "video": "uploads/VideoUpload/_05-Oct-21-09_45.mp4", "slug": "Harmony-Freebush-Talks-Vaginas", "video_cat": 1, "sub_cat": 21, "poster_image": "uploads/poster/_05-Oct-21-09_45.jpg", "desc": "Meet Harmony Freebush, Stefan Van Der Bled and Fanny Glitterwinkle; the characters featured in an online content series for Carefree's Be Real campaign, via DDB Sydney. The films take a satir