tween the audio and video delivers the shocking truth bringing society in confrontation with its own doing and forcing it to stop the cycle of deadly silence by speaking up.Creative ExecutionThe visual effects were divided in camera effects and projection mapping. The shoot comprised of a projection mapped surface that served to create the environments in which our lead characters interacted and were interacted with. The film was shot against a green screen to get all the character animation in the background that interact with the model, saving time instead of keyframing character animation. Rough design scamps were created to get an idea of composition and where the characters would be placed in the scene. It provided parameters to work within, when the actors performed in front of camera in the greenscreen studio. The green screen footage was treated after to make it look and feel like hand drawn animation and to tie it to the overall aesthetic of the commercial. Each background was digitally painted and then separated into mid, fore and background layers to be distributed in 3D space. A virtual camera was animated through the scene to create a parallax effect and give the illusion that the scene was living and breathing. The art direction overall served the concept of fairytales well, adding to it a theatrical feel.", "keywords": "Sexual Abuse", "duration": 52.0, "record_date": "01 Feb 2016", "country": "Egypt", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "HEBA RADWAN", "director": "MARWAN YOUNIS", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-16_41.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-16_41.jpg", "created_at": "2021-10-05T14:41:43.587Z", "modified_at": "2021-10-05T14:41:53.633Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 99, "fields": {"user": null, "vendor_id": 0, "title": "France - \"The Lover\"", "video": "uploads/Video