slug": "USA-FEMALE-CONDOM", "video_cat": 1, "sub_cat": 27, "poster_image": "uploads/poster/_05-Oct-21-16_54.jpg", "desc": "We dont know much about female condoms, and what we do know seems weird. Theyre big. Theyre baggy. Theyre inside out and upside down. A new ad campaign from Veru Healthcare and boutique agency New Honor Society takes an overt swing at the stigma surrounding the female condom, tackling its foreignness head on.\r\nThe video promotes the FC2 Female Condom, currently the only FDA-approved female condom. It starts out with a white couch and a frank tone. \"Welcome,\" the spokeswoman says, talking into the camera. Im Amanda, author of nothing and star of 'nobody cares,' here to give you some unsolicited advice about boning. \r\nAmanda is really New Honor Society senior copywriter Amanda Burch, who wrote the script. She stood in for a famously taboo-testing comedienne in the pitch video, but when Veru Healthcare saw her performance, they warmed to her quirky, bawdy, informative presence and chose her to star instead.\r\nBurch answers the most common questions and misperceptions about the female condom, like \"Will it fit me?\" \"Will it stay in?\" \"Can I still have sex in my favorite positions?\" \"Can it, you know, keep up?\" (Answers: Yes, Yes, Yes, and Go For It.) \r\nShe then gives a step-by-step rundown of how to use the FC2 Female Condom, and proves  via nude cartwheels, hula hooping, pogo stick jumping, and lazy cereal-eating  that the condom can hold its own during the most athletic, determined encounters.", "keywords": "Female Condom", "duration": 174.0, "record_date": "01 Apr 2017", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Derek Burr", "director": "Matt Glarner", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-16_54.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-16_54.jpg", "created_at": "2021-10-05T14:54:09.799Z", "modified_at": "2021-10-05T14:54:09.799Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 103, "fields": {"user": null, "vendor_id": 0, "title": "Vagina Pop-Up Kickstarter", "video": "uploads/VideoUpload/_05-Oct-21-19_00.mp4", "slug": "Vagina-Pop-Up-Kickstarter", "video_cat": 1, "sub_cat": 11, "poster_image": "uploads/poster/_05-Oct-21-19_00.jpg", "desc": "Vaginas and Periods 101: A Pop-Up Book is a fun and creative way to learn more aboutvaginas and periods! The book uses pop-ups to explain how the female reproductive system works, colorful graphics to normalize anatomy aesthetics and discharge, and describes various menstrual product options. As licensed mental health therapists and sex educators, we teach a lot of young people and we saw a need to normalize menstruation and could't believe this book didn't already exist!", "keywords": "sex education, menstrual education, teens, children, puberty", "duration": 93.0, "record_date": "01 Dec 2017", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_00.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_00.jpg", "created_at": "2021-10-05T17:00:29.054Z", "modified_at": "2021-10-05T17:00:29.054Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 104, "fields": {"user": null, "vendor_id": 0, "title": "Canada - \"The Gay Sweater", "video": "uploads/VideoUpload/_05-Oct-21-19_05.mp4", "slug": "The-Gay-Sweater-Canada", "video_cat": 1, "sub_cat": 29, "poster_image": "uploads/poster/_05-Oct-21-19_05.jpg", "desc": "The Gay Sweater [video] was done by Saatchi & Saatchi Toronto, Smith and Jones Films advertising agencies for The Canadian Centre for Gender and Sexual Diversity/ CCGSD in Canada.", "keywords": "Gay Sweater Canada", "duration": 121.0, "record_date": "01 Mar 2016", "country": null, "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Michelle Orlando, Rebecca Adams", "director": "Reynard Li", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_05.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_05.jpg", "created_at": "2021-10-05T17:05:31.157Z", "modified_at": "2021-10-05T17:05:31.157Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 105, "fields": {"user": null, "vendor_id": 0, "title": "UK - \"NEVER ALONE\"", "video": "uploads/VideoUpload/_05-Oct-21-19_07.mp4", "slug": "UK-NEVER-ALONE", "video_cat": 1, "sub_cat": 29, "poster_image": "uploads/poster/_05-Oct-21-19_08.jpg", "desc": "The worlds of both Beer and Rugby project a traditional, stereotyped view of what it means to be a man. And beer advertisers reinforce that view with clichd representations of men that are out-dated and strictly heterosexual.Guinness, however, celebrates those with the confidence to carve their own path. So for the 2015 Rugby World Cup, we used advertising to challenge the representation of men and confront prejudice towards gay men.To do this, we told the story of a man who famously represented all the gender stereotypes of men, while being in reality, the complete oppositeStrategy:Guinness Made of More brand platform is more than just an endline, its a philosophy. Its about embracing bold choices, inspiring its drinkers with stories of people who act with integrity, and celebrating strength of character  all facets of what it means to be a modern man.When you look beyond the machismo, rugby is as much about mentality as it is physicality. With Guinness longstanding association with rugby (over 50 years intimate knowledge of the game) we were in a unique position to go deeper and challenge the stereotypes about rugby players.Gareths story is an embodiment of the Made of More attitude: the triumph of his inner qualities of courage and resilience in the face of adversity, and the empathy and acceptance of his teammates and indeed the wider rugby community. It issues an implied challenge to the world: if this was possible in rugby, why not everywhere?Outcome:The reception from the public was outstanding, with a 99% positive approval rating.The ad was seen by over 23 million people online alone, with a further 23 million views offline views. Over 1.4 million people went on to watch the documentary.People who viewed the ad described how it had pushed boundaries and recognised the bravery and great strength embodied by Gareth Thomas.International sports stars like Eoin Morgan, Jamie Heaslip and Brian ODriscoll shared their support online, and Gareth Thomas appeared on the Late Late Show in Ireland, reaching approx. 30mill people with his story and message of support and strength for all gay sportspeople. The host Ryan Tubridy described the campaign as having struck a chord with the nation. But most importantly it has reopened a conversation about the readiness of all sports, however macho, to accept, support and rally around players, irrespective of their sexuality.Execution:Our film told the story of Gareth Thomas  the worlds first openly gay sportsman. The film pivots around the moment Gareth came out to his closest Wales teammates  a moment he describes as being in equal measure terrifying and relieving as he experienced their total acceptance. A 5-minute documentary located on YouTube told his wider life story, narrated in Gareths own words. This showcased the pain of his life in the closet that nearly drove him to suicide, and the immense relief he experienced having been accepted as a gay man by his teammates, his country and the public alike. The spot was played around RWC games, and launched alongside the YouTube documentary one week before the tournament started. Both films ended with the following poignant line, summarizing the universal thought captured in the story: Gareth Thomas. Thought he was alone. Always part of a team.Brief with projected outcomes: In sport, vulgarisms like poof and queer have always been part of the camaraderie or banter. Its almost unknown for a successful sportsman to come out as gay while playing. When the tough and 100% masculine Wales & Lions Rugby team captain Gareth Thomas came out, it challenged both male gender stereotypes and prejudicial views about gay men. Our Rugby World Cup campaign celebrated his story to encourage those struggling with gender confusion and to promote a positive shift in societys attitudes to men coming out as gay.", "keywords": "gay lesbian coming out", "duration": 120.0, "record_date": "01 Mar 2016", "country": "UK", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Stink, London", "director": "Ben & Dan Tubby (Tubby Brother)", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_07.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_07.jpg", "created_at": "2021-10-05T17:08:02.145Z", "modified_at": "2021-10-05T17:08:02.145Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 106, "fields": {"user": null, "vendor_id": 0, "title": "Israel - \" THE SEXUALLY ABUSED\"", "video": "uploads/VideoUpload/_05-Oct-21-19_10.mp4", "slug": "THE-SEXUALLY-ABUSED", "video_cat": 1, "sub_cat": 33, "poster_image": "uploads/poster/_05-Oct-21-19_10.jpg", "desc": "SEXUAL ASSAULT AWARENESS", "keywords": "Sexual Abuse Rape", "duration": 80.0, "record_date": "01 Aug 2002", "country": "Israel", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "McCann Tel Aviv", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_10.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_10.jpg", "created_at": "2021-10-05T17:10:53.961Z", "modified_at": "2021-10-05T17:10:53.961Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 107, "fields": {"user": null, "vendor_id": 0, "title": "PRACTICAL STRATEGIES AND POSITIONS FOR COMFORTABLE PLEASURE", "video": "uploads/VideoUpload/_05-Oct-21-19_13.mp4", "slug": "PRACTICAL-STRATEGIES-AND-POSITIONS", "video_cat": 1, "sub_cat": 47, "poster_image": "uploads/poster/_05-Oct-21-19_13.jpg", "desc": "This first volume in the Sexual Ergonomics series is dedicated to Hip and Knee Pain & Surgery. FULL LENGTH VIDEO available at video.ergoerotics.com. SexSmartFilms.com members receive a 10% discount with code SEXSMART181 BACKGROUND People with hip or knee problems often find their sexual options limited because of pain with sexual activity or movement restrictions with a new joint. CONTENT This video introduces a variety of options to expand a couple's sexual routine and satisfaction, especially with hip or knee problems. It is based on the Ergoerotics program (ergoerotics.com), a systematic approach to comfortable pleasure which fits the activity and environment to the needs of the unique individuals in the couple. It is a valuable resource for couples, health education courses, and physical rehabilitation clinics, especially before and after joint replacement surgery. CREATOR Heather Howard, PhD, MPH is a sexuality counselor, educator, lecturer and researcher (HeatherHoward.com). She developed the Ergoerotics program to help people find comfortable pleasure at any age and with any physical health challenge. She consults with patients in person and by video chat, in order to help them meet their sexual goals.", "keywords": "sex position, chronic pain, physical therapy, occupational therapy, hip pain, knee pain, osteoarthritis, ergonomic", "duration": 116.0, "record_date": "01 Jan 2018", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "www.Ergoerotics.com", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_13.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_13.jpg", "created_at": "2021-10-05T17:13:35.954Z", "modified_at": "2021-10-05T17:13:35.954Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 108, "fields": {"user": null, "vendor_id": 0, "title": "Canada - \"#20minutesofaction4change\"", "video": "uploads/VideoUpload/_05-Oct-21-19_16.mp4", "slug": "20minutesofaction4change", "video_cat": 1, "sub_cat": 20, "poster_image": "uploads/poster/_05-Oct-21-19_16.jpg", "desc": "One in five women will be sexually assaulted during their college and university years. When the Stanford rapists father used the deplorable euphemism 20 minutes of action to describe the rape his son committed, it helped to shed light on the misogynistic attitudes that are alive and well in our society and especially in our schools. White Ribbon, the worlds largest movement of men and boys working to end violence against women tasked us with giving men and dads a way to take action and be a part of the solution. Execution: We launched with a site to educate and encourage dads to commit to taking 20 minutes to talk to their sons about sexual consent, boundaries and respect for women. We then Leverage the UNs International Day for the Elimination of Violence Against Women (Nov 25th), and invite dads and all supporters across the globe to take part in To support this initiative on the day, we also asked influencers and organizations to give up their social media channels, and allows us to take over their website (landing pages) for 20 minutes in a show of solidarity. Campaign Description:", "keywords": "Consent", "duration": 124.0, "record_date": "01 Nov 2016", "country": "Canada", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "J. Walter Thompson Toronto", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_16.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_16.jpg", "created_at": "2021-10-05T17:16:17.981Z", "modified_at": "2021-10-05T17:16:32.207Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 109, "fields": {"user": null, "vendor_id": 0, "title": "USA - \"The LGBTQAlphabet\"", "video": "uploads/VideoUpload/_05-Oct-21-19_19.mp4", "slug": "The-LGBTQAlphabet", "video_cat": 1, "sub_cat": 29, "poster_image": "uploads/poster/_05-Oct-21-19_19.jpg", "desc": "For this year's Pride,Wieden+Kennedy New York collaborated with The LGBT Community Center, NYC's home and hub for the LGBTQA community, to create a film celebrating the entire Equinox \"LGBTQA Alphabet\" twenty-six ways to share who you are and how you love. Because all voices deserve to be heard.", "keywords": "Pride", "duration": 276.0, "record_date": "01 June 2017", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "EQUINOX", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_19.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_19.jpg", "created_at": "2021-10-05T17:20:00.503Z", "modified_at": "2021-10-05T17:20:00.503Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 110, "fields": {"user": null, "vendor_id": 0, "title": "UK - \"Change the face of HIV\"", "video": "uploads/VideoUpload/_05-Oct-21-19_22.mp4", "slug": "Change-the-face-of-HIV", "video_cat": 1, "sub_cat": 30, "poster_image": "uploads/poster/_05-Oct-21-19_22.jpg", "desc": "HIV is increasingly prevalent in areas throughout the UK, affecting more people across a broad spectrum of age, gender, race and sexuality. GPs dont think to test for HIV even when patients are presenting indicative symptoms. Our film aims to change that by getting GPs to think to test for HIV. The Film titled Change the face of HIV was done by Havas Lynx Manchester advertising agency for HIV awareness in United Kingdom.", "keywords": "HIV", "duration": 65.0, "record_date": "01 Dec 2016", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Rob Wills, Bridget Pelicias", "director": "Jamie Delaney", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_05-Oct-21-19_22.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_05-Oct-21-19_22.jpg", "created_at": "2021-10-05T17:22:43.780Z", "modified_at": "2021-10-05T17:22:43.780Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 111, "fields": {"user": null, "vendor_id": 0, "title": "China - \"Yasmins Sex-Ed Revolution\"", "video": "uploads/VideoUpload/_06-Oct-21-18_43.mp4", "slug": "Yasmins-Sex-Ed-Revolution", "video_cat": 1, "sub_cat": 27, "poster_image": "uploads/poster/_06-Oct-21-18_43.jpg", "desc": "China carries out a mind-boggling 13 million abortions a year, the highest abortion rate in the world. By contrast, there are only 16 million births every year. Information regarding contraception is absent in school curriculums and young Chinese seek out sex knowledge from their equally uninformed peers, or from Internet porn. As such, the general attitude to sex in China is immature and unsafe sex is prevalent.Contraception advertising is generally limited to promoting condoms (targeting men), whilst most communication to women around this topic is adverts for cheap abortions for less than US$100. At the same time, coitus interruptus is still the most preferred form of pregnancy avoidance, with about 2.5% preferring the morning after pill.Bayer Womens Healths COC (combined oral contraceptive pill)  Yasmin  was given over-the-counter CFDA approval on 6th July 2016  and so we embarked on a plan to overcome ingrained sex habits.Execution:We partnered with Chinas #1 dating and relationship host to produce two candid gender-specific sex-ed videos and distributed it through SuperTimetable, Chinas number one curriculum app, reaching a network of 3,000 Chinese universities, covering 18 million students direct to their smartphones.We surprised them by dropping our class (educational videos) into every students daily curriculum as a must-take class that required their attendance at 9pm every day. To keep the birds and bees buzzing, we created a #HowtosurvivetheworldoutsideGuide on Weibo (Chinas top social network) and a series of infographics about different contraception methods and circulated them on social media. On Sep. 23, before World Contraception Day, we organized a live-stream event, featuring:International students from around the world to share the sex-ed they received at school. Celebrities to share their views on the importance of contraception. Renowned gynaecologist to give professional sexual guidance.Synopsis:With approval to be sold as an Over The Counter medication without a prescription (for the first time), female contraceptive pill Yasmins goal was to increase sales by over 10%. However, with poor sex education and lack of category understanding, the job would require a dynamic campaign on a minimal budget, to influence young Chinese adults whose regular contraceptive methods included from the morning-after-pill to abortions. Creating social buzz was demanded from this limited budget campaign.Outcome:This campaign truly was revolutionary. A video of such scale on sex-education was something that authorities would never engage in or promote, students were stunned, curious and most importantly were talking about contraception and Yasmin.Our videos achieved 12 million viewership in the first week of distribution, then continued to climb to 30 million the first month as social sharing brought the video to broader audiences. Our Weibo had over 20 million reads and over 100,000 discussions. Over 40 mainstream media reported this event and crowned it an unprecedented event owed to generations in China.Yasmins awareness rose dramatically, on Baidu Index, search increase of 60%, with search on mobile increasing 68%. As a direct result, sales of the morning-after pill, which for a very long time in China has been considered as the regular conception method, dropped 44% YOY where COC increased by 42%.Strategy:Most women give birth to their first child in China by the age of 27-28, by which time they would be married with a job, and able to take on the personal and financial responsibility for looking after a child. Under this age, therefore, is when much of abortions happen. We decided that the student population was the most in need of education on COC pills.We realised we could not drive sales without educating our young women and men about their options in safe sex. Creating a dialogue on the topic of sex offered us a way to both grab attention in a pretty conservative society, and nurture a change in behaviour.We started our revolution on Chinese university campuses and delivered straight to the hands of the young Chinese students  through their mobile.", "keywords": "China Sex Education", "duration": 133.0, "record_date": "01 Oct 2016", "country": "China", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Phd, Shanghai", "director": "Eddie Weng (Phd China)", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_06-Oct-21-18_43.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_06-Oct-21-18_43.jpg", "created_at": "2021-10-06T16:43:09.587Z", "modified_at": "2021-10-06T16:43:09.587Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 112, "fields": {"user": null, "vendor_id": 0, "title": "Peru - \"Real problems, 2\"", "video": "uploads/VideoUpload/_06-Oct-21-18_45.mp4", "slug": "Peru-Real-problems", "video_cat": 1, "sub_cat": 7, "poster_image": "uploads/poster/_06-Oct-21-18_45.jpg", "desc": "According to a 2013 UNICEF study, 15 out of every 100 teenage girls in Peru under 16 are mothers, and the average age for first sexual activity is between 15 and 17 years old in urban areas; in rural areas the age drops to 10-14 years of age.To address this situation and the social, economic and family issues that surround it, and to take direct aim at the problem of teenage pregnancy, Save the Children Peru partnered with McCann Lima to create Proble + Reales (Real Problems), an educational platform that seeks to minimize disinformation around teen pregnancy -- using classroom subjects to make the information more familiar.McCann Lima created the idea of hacking ordinary math problems to turn them into a medium to sex education by using traditional objects, such as fruits and household objects, to replace elements associated with pregnancy and childbirth, such as diapers and bibs.Presented on the website www.problemasreales.com (realproblems.com) and in printed promotional kits (flyers and leaflets with suggested exercises), the initiative was activated both among students and teachers in the Peruvian public -school system, as well as among parents and parents groups.The campaign raised tangible discussions and dialogues between parents and between parents and eductors in a very conservative culture, because without the support of parents, sex education for schoolchildren would not become acceptable or effective.", "keywords": "Sex Education Peru", "duration": 112.0, "record_date": "01 May 2017", "country": "Peru", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Save The Children", "director": "MARIA VILLALOBOS", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_06-Oct-21-18_45.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_06-Oct-21-18_45.jpg", "created_at": "2021-10-06T16:45:20.046Z", "modified_at": "2021-11-21T18:47:15.080Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 113, "fields": {"user": null, "vendor_id": 0, "title": "Sri Lanka - \"JOB DESCRIPTION\"", "video": "uploads/VideoUpload/_06-Oct-21-18_47.mp4", "slug": "JOB-Description", "video_cat": 1, "sub_cat": 20, "poster_image": "uploads/poster/_06-Oct-21-18_48.jpg", "desc": "Sexua