eo_cat": 1, "sub_cat": 33, "poster_image": "uploads/poster/_06-Oct-21-19_04.jpg", "desc": "The Ambient Advert titled Sexual consent awareness was done by Marc Usa advertising agency for KnowNo in United States.", "keywords": "Sexual Consent Awareness", "duration": 80.0, "record_date": "01 Sep 2016", "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Marc Usa", "director": "Robert Stockwell", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_06-Oct-21-19_04.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_06-Oct-21-19_04.jpg", "created_at": "2021-10-06T17:04:24.107Z", "modified_at": "2021-10-06T17:04:36.190Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 119, "fields": {"user": null, "vendor_id": 0, "title": "Mexico - \"DEEP PIPES\"", "video": "uploads/VideoUpload/_06-Oct-21-19_10.mp4", "slug": "Mexico-DEEP-PIPES", "video_cat": 1, "sub_cat": 27, "poster_image": "uploads/poster/_06-Oct-21-19_10.jpg", "desc": "The first pornographic film that teaches young people about sexual and reproductive health, because who better to teach you about sex than porn stars? And with what better medium than the internet?\r\nDeep Pipes is part of the #PornEducation initiative, a digital social movement for free and responsible sexual and reproductive health. The Legion developed this project from first conception right through to the films production and release. The film has already had a huge impact thanks to its original approach that has turned a traditionally taboo subject into a positive one that cannot be censored.\r\nThe campaign and film have provided plenty to talk about, as sex is a subject rarely addressed in our society. This film is the beginning of an entire educational movement and shows that even the most delicate subjects can be approached objectively and creatively and that effective ideas can be a valuable tool for connecting with the public.", "keywords": "condom birth control", "duration": 508.0, "record_date": "01 May 2017", "country": "Mexico", "hit_count": 0, "rated_by": 0, "rating": 5.0, "producer": "Pelculas Imaginarias", "director": "Guillermo Gardario", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_06-Oct-21-19_10.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_06-Oct-21-19_10.jpg", "created_at": "2021-10-06T17:10:24.588Z", "modified_at": "2021-10-06T17:10:36.390Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 120, "fields": {"user": null, "vendor_id": 0, "title": "Are you ready for Marriage?", "video": "uploads/VideoUpload/_12-Nov-21-15_21_34.mp4", "slug": "you-for-marriagenonenonetrue-ready-are", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_12-Nov-21-15_23_06.jpg", "desc": "ourtesy of Prelinger Archives\r\nAre You Ready for Marriage? was produced to stem the epidemic of youthful, impetuous, and unsuccessful marriages following World War II. The Coronet catalog entry for the film reads: A very young couple have just about decided to elope since the girls parents object to the marriage. However, they first decide to talk over their problem with the marriage counselor at the church. During this talk they find that they really don't know too much about each other, and the counselor suggests that they should ask themselves some questions before getting too serious. Questions like do they have similar backgrounds?, are they real friends?, and do they understand marriage? He also stresses that when people are ready for marriage, they sense a new feeling between them-a feeling of paired unity. In conversation, I changes to we. \r\n\r\nThe film begins with a long, slow kiss on the porch, an unusually intimate moment for an educational film. Things rapidly change, though, when Sues parents forbid her engagement to Larry. Led by Mr. Hall, the minister/counselor, Sue a Larry quickly learn that theres more to marriage than mere sexual attraction-boing! Mr. Hall uses the Marriage Development board, an awkward but compelling visual aid featuring little dolls linked by rubber bands, to illustrate the concepts of psychological distance and emotional makeup. Fascinating graphs emerge from the edges of this apparatus illustrating marital success as it relates to age before marriage and length of engagement. Cupids checklist, which in one form or another shows up in most American premarital training literature, asks whether the couple comes from similar backgrounds, whether they are real friends, and whether they understand marriage. The temptation for us to rate ourselves on these scales, even if we fail, is irresistible.\r\n\r\nTime hasn't been friendly to this film, but its out-datedness makes it amusing and fascinating to watch. The teenage actors squirm and whine in their unrealizable passion, and Mr. Hall lectures them at some length. There is a great deal of talk in this film, probably because it strove to bring sex- and love-crazed teenagers back into the grown-up, logocentric world of reason, and Mr. Hall pursues the praiseworthy goal of getting Sue and Larry to talk about things that matter. No difference of opinion? he asks. Or no opinion? With little subtlety, the film also raises the issue of correct gender roles. Its all one way or another, as Sue explains: But I don't want a girl  I want a man, like Larry. The ending is happy. Sue and Larry, engaged to be engaged, realize they now have more than boing going for them.\r\n\r\nTheres a wealth of good advice in Are You Ready for Marriage?, but it seems pitifully naive next to training films for slightly older people (This Charming Couple and Whos Boss, for instance, focus on the arbitration of power relations in marriage). Aside from Sues parents insistence that she get at least some college education, Are You Ready for Marriage? does not anticipate much of the heavy stuff that serious couples inevitably experience, perhaps in order not to frighten teens away from marriage altogether. Yet, by stressing resolution of key issues prior to marriage and ignoring those that emerge later on, the film suggests that social contradictions somehow dissolve on wedding day. And of course, there is no real consideration of how society dictates different roles for men and women within the confines of matrimony.\r\n\r\nAre You Ready for Marriage? manages to be simultaneously touching and annoying. It is a film about acceptance and submission. Sue and Larry learn on their own to accept societys conventional wisdom. No one could accuse the authorities behind films like these of serving their own interests-the films really were for the good of the children. But even if the advice is correct, does the survival of our culture require children to accept the dictates of their counselors and parents with so little imagination? We survived the sixties, when all rules seemed up for grabs, but have we truly gotten the fifties, with its complexes of obedience and its deference to authority, out of our systems?\r\n\r\nFrom Educational Screen, September 1950: The evaluating group felt that the film should be very effective on the high school level both in group and individual counseling. In addition to its effectiveness in high school guidance situations, the film should also be useful in extra-school young peoples organizations, as well as teacher and parent study groups. The producers are to be complimented on creating an atmosphere of life-like situations. The film skillfully avoids stereotyped characters, stale and trite expressions, and unnaturalness.\"", "keywords": "", "duration": 962.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "social guidance marriage Gender roles", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_12-Nov-21-15_21_34.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_12-Nov-21-15_23_06.jpg", "created_at": "2021-11-12T09:53:07.116Z", "modified_at": "2021-11-13T06:44:52.370Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 121, "fields": {"user": null, "vendor_id": 0, "title": "Is This Love?", "video": "uploads/VideoUpload/_12-Nov-21-15_24_09.mp4", "slug": "is-this-lovenonenonetrue", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_12-Nov-21-15_25_37.jpg", "desc": "Two couples are getting married - one couple rush to tie the knot, while the other's courtship lasts a lot longer. The two relationships are compared.\r\n\r\nCourtesy of The Prelinger Archive", "keywords": "Social Guidance Marriage Gender Roles", "duration": 878.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_12-Nov-21-15_24_09.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_12-Nov-21-15_25_37.jpg", "created_at": "2021-11-12T09:55:37.547Z", "modified_at": "2021-11-13T14:28:49.368Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 122, "fields": {"user": null, "vendor_id": 0, "title": "Cindy Goes to a Party", "video": "uploads/VideoUpload/_12-Nov-21-15_26_14.mp4", "slug": "goes-to-a-partynonenonetrue-cindy", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_12-Nov-21-15_27_12.jpg", "desc": "Courtesy of Prelinger Archives\r\nCinderella resurfaced in Lawrence, Kansas, in 1955, this time as Cindy, a bit of a tomboy who is decidedly unsure of her social status. Her vexing problem: some of the kids at school are having a birthday party, and she hasn't gotten an invitation. Falling asleep, Cindy wakes and is greeted by a young woman in formal dress identifying herself as her fairy godmother, who transports her and friend Dennis (who needs some education in manners) to the party. While the other partygoers, quite unaware of the intense training happening around them, play games and consume refreshments, the fairy godmother sets up a series of didactic demonstrations of proper party behavior for Cindy and Dennis. Liberal use is made of the magic wand, superimposed titles (\"Don't break things\" and \"Leave on time\"), and minor cinema trickery. When Cindy wakes, the invitation is in her mother's hands and she really is going to the party. But she's changed, like so many dreamers in educational films. No longer a tomboy, she is growing into a \"good girl.\"Educational and training films are full of dreams, an ideal vehicle to enable the imagination of scriptwriters. Troubled protagonists fall asleep and are visited by supernatural figures with special expertise and knowledge. Although few mid-century educational films ever explicitly counseled children on the acceptance of proper gender roles, a good many of them contain strong implicit messages to this effect. For Cindy, gravitating away from a mixed-gender identification to full-blown \"girliness\" is presented as a necessity and as an answer to her expressed need to \"fit in.\" This is the way it came down in 1955, and not enough has changed. As scriptwriter Trudy Travis reveals in her interview (on the Make Mine Freedom disc), Centron shot most of its productions in and around Lawrence, using nonprofessional talent from the nearby University of Kansas and elsewhere. Their films collectively form an unusually interesting record of the \"look and feel\" of Lawrence and the surrounding area throughout the postwar years. While Centron, like other producers, generally avoided explicit regional references, it made no attempt to homogenize the distinctive speech and mannerisms of its prairie-reared talent and, perhaps without intending to, create movies that have real ethnographic and documentary value quite aside from their declared subject matter.", "keywords": "Gender roles Social guidance Etiquette Recreation", "durat