"duration": 3117.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_12-Nov-21-16_09_16.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_12-Nov-21-16_13_55.jpg", "created_at": "2021-11-12T10:43:56.199Z", "modified_at": "2021-11-13T13:56:15.011Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 136, "fields": {"user": null, "vendor_id": 0, "title": "France - The Extendables", "video": "uploads/VideoUpload/_12-Nov-21-16_17_15.mp4", "slug": "-the-france-extendablesnonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_12-Nov-21-16_17_47.jpg", "desc": "Strategy:\r\nThe show, about extraterrestrial puppets coming to earth, allows romancing parents to monitor the kids by securely pairing Mum or Dads smartphone to any tablet, desktop computer, laptop or smart TV with a webcam. If kids wander away from the screen, the motion detector sends an alert to avert the risk of an untimely surprise. Should parents need a little more time when the video reaches its final minute, theres an option to extend for another five minutes, time and time again.The Extendables comes after Four Seasons found a third of Australian parents had a fear of being interrupted during sex. On top of this, 22% of parents reported having less quality time for romance and sex with partners at times when the kids are around. Given almost 73% of respondents have been interrupted by their kids during sex, The Extendable provides a fun solution for the whole family.\r\nCampaign Description:\r\nDiscussing the issue of maintaining a sex life even after the kids are born is never an easy task, especially considering Western religious conventions that view sex between parents solely as a mean to procreate further.We launched  The Extendables : a new online cartoon we created and produced to keep kids busy while parents get busy - in the bedroom.\r\nOutcome:\r\nIn the first 6 hours of the launch:1 MILLION+ PEOPLE VIEWED THE LAUNCH VIDEO 200.000+ PEOPLE SHARED THE POSTS 80.000+ USERS EXTENDED THEIR TIME IN BED In total23% LAUNCH VIDEO ENGAGEMENT RATE (above the average of 15% for FB video engagement)20 MILLION+ OVERALL MEDIA IMPRESSIONS AND FAMOUS NATIONAL RADIO SHOWS TALKED ABOUT THE CAMPAIGN\r\nExecution:\r\nTo install and run The Extendables, parents can securely pair their smartphones to any tablet, desktop computer, laptop or smart TV with a webcam by going to TheExtendables.com.au on both devices and simply entering a code. Once paired, parents can control the cartoon and receive an alert if their kids move away from the screen from another room in the house. Only those who pair their phone to the webcam can use the motion sensor function: The Extendables program doesnt share, receive or save any visual data to ensure user privacy. The Extendables was launched through a Facebook and Instagram social media campaign consisting of a launch trailer and various social posts and is available now for free from TheExtendables.com.au or from FourSeasonsCondoms.com.au.\r\nSynopsis:\r\nFour Seasons is an Australian company that produces high-quality condoms for all shapes and sizes. Most of the communication in their category is aimed at encouraging singles and teens to wear condoms, yet Four Seasons identified another target audience: parents. 30% of parents wear condoms for a variety of reasons (the main ones being not wanting to take the pill or have a vasectomy). Four Seasons saw an opportunity in growing their business by becoming the preferred brand for those who dont have much time for sex, but who will always reach for the condoms when they do.\r\nRelevancy:\r\nThis campaign is relevant for Media Lions because its main media is an actual kids video cartoon we created and produced. The cartoon was intentionally designed to provoke discussion amongst parents and parent groups about the lack of sex parents have. Our media, in the form of a cartoon and app featuring fuzzy creatures from outer space, flipped the rules of pester power and offered a creative solution to an age-old problem.", "keywords": "Condoms", "duration": 128.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_12-Nov-21-16_17_15.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_12-Nov-21-16_17_47.jpg", "created_at": "2021-11-12T10:47:47.708Z", "modified_at": "2021-11-13T13:53:52.930Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 137, "fields": {"user": null, "vendor_id": 0, "title": "Belgium -\"FOOTBALL OR FATHER\"", "video": "uploads/VideoUpload/_12-Nov-21-16_18_00.mp4", "slug": "belgium-football-fathernonenonetrue-or", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_12-Nov-21-16_18_31.jpg", "desc": "Brief ExplanationLove Condom is a challenger brand of condoms in Belgium. It doesnt have the media budget to rival big names like Durex or Manix. The BriefThe aim of the campaign was to make the brand stand out in an extremely competitive sector by communicating differently from its competitors. How the final design was conceived each calendar has 28 condoms corresponding to the 28 days of tournament matches. Each condom is to be used 9 months before the match you dont want to miss. Each condom is tailored to the match. When a condom is removed, a blank square can be seen underneath. This is for filling in the match result you arent going to miss.The calendar has been designed by an illustrator. On the left, the illustrations represent the life of the supporter and therefore what will happen if the person chooses to use protection, i.e. not miss the match. On the right, the illustrations represent a dads life and therefore what can happen if the person becomes a dad during the UEFA European Championship. Indication of how successful the outcome was in the market calendar was delivered to the most renowned sports journalists in the country. It is 60 cm by 80 cm and is designed to be kept until the UEFA European Championship in France. This is why its in XX cardboard. Under each condom is space for writing the score of the match that the person didnt miss because they wore a condom. The illustrations on the left represent the football world, the supporters choice and their team at the UEFA European Championship. On the right, they represent the birth and choice to be a dad during the World Cup. The two worlds stand face-to-face and its up to the person to make their choice. The calendar is delivered with a letter addressed to the sports journalists.", "keywords": "Condoms", "duration": 90.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_12-Nov-21-16_18_00.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_12-Nov-21-16_18_31.jpg", "created_at": "2021-11-12T10:48:31.965Z", "modified_at": "2021-11-13T13:50:26.946Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 138, "fields": {"user": null, "vendor_id": 0, "title": "India \"FOOTBALL\"", "video": "uploads/VideoUpload/_12-Nov-21-16_18_39.mp4", "slug": "footballnonenonetrue-india", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_12-Nov-21-16_18_54.jpg", "desc": "The Film titled FOOTBALL was done by Ambience D'arcy Mumbai advertising agency for the product: Kamasutra Sport Condoms (brand: Kamasutra) in India.", "keywords": "Condoms", "duration": 19.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_