 183, "fields": {"user": null, "vendor_id": 0, "title": "Sex on the Map", "video": "uploads/VideoUpload/_15-Nov-21-01_47_32.mp4", "slug": "sex-on-the-mapnonenonetrue", "video_cat": 1, "sub_cat": 11, "poster_image": "uploads/poster/_15-Nov-21-01_49_00.jpg", "desc": "The film was designed to be used in sexual education programs in middle schools.\r\n\r\nAbout the film\r\n\r\nSex on the map is an educational hand-drawn film based on young peoples own questions. The setting takes place in a school library where five students have voluntarily assembled for tutoring in math. Their regular teacher does not show up and their substitute teacher Jao would rather teach sex education than math. What an outstanding video! It took me years to learn everything that was covered in this 28 minute film!Posted on our website Genitals, vaginal corona, sexual acts, masturbation and sexual interaction is all discussed. There are also side-stories about the students themselves: What really happened between Abdu and Melody in rehearsal studio two weeks ago? And will Kim and Hanna dare to get closer? The film is available in Swedish with English or Spanish subtitles. There is also a Finnish language version. The film is 28 minutes long. The film is produced by RFSU and UR with support from the Inheritance Fund Commission. About this guide This guide offers suggestions on how you can use the film as a starting point in your sex- and relationship education programs in middle school and early high school. You can even work with just one of the films six parts at a time. There are two tutorials for the film: a shorter tutorial that comes with the film and a more detailed one found on the web. Because it is a pdf file, we can revise it and would look forward to comments or suggestions on how we can improve it.\r\n\r\nPlease contact us at RFSU (info@rfsu.se). The tutorial is aimed at teachers in addition to general school staff, youth, and other educators working with youth. This guide is a way to work with the film. Many other methods are of course useful.\r\n\r\nAt the end of the tutorial, we give some examples of materials that can be complementary. Download the guide (pdf) Informacin en espaol", "keywords": "sex education middle school Sweden", "duration": 1680.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-01_47_32.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_15-Nov-21-01_49_00.jpg", "created_at": "2021-11-14T20:19:01.060Z", "modified_at": "2021-11-16T14:39:31.854Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 184, "fields": {"user": null, "vendor_id": 0, "title": "Margaret Sanger: Interviewed by Mike Wallace", "video": "uploads/VideoUpload/_15-Nov-21-01_49_25.mp4", "slug": "margaret-by-sanger-interviewed-wallacenonenonetrue-mike", "video_cat": 1, "sub_cat": 27, "poster_image": "uploads/poster/_15-Nov-21-01_50_24.jpg", "desc": "In 1957, an aging Margaret Sanger, founder of Planned Parenthood and the international birth control movement, agreed to an interview with CBS News Mike Wallace. In stark contrast with the sympathetic reception Sanger could expect to receive today in a network television interview, Wallace hammered Sanger with difficult questions and caught her in contradictions, while Sanger squirmed, fidgeted, and denied statements she had made only a week earlier in pre-interview discussions with CBS staff.", "keywords": "Margaret Sanger Mike Wallace", "duration": 1801.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-01_49_25.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_15-Nov-21-01_50_24.jpg", "created_at": "2021-11-14T20:20:25.336Z", "modified_at": "2021-11-16T14:38:20.990Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 185, "fields": {"user": null, "vendor_id": 0, "title": "Who Are You?.co.nz", "video": "uploads/VideoUpload/_15-Nov-21-01_50_49.mp4", "slug": "who-youconznonenonetrue-are", "video_cat": 1, "sub_cat": 20, "poster_image": "uploads/poster/_15-Nov-21-01_51_47.jpg", "desc": "Trigger Warning: This video shows a fictional scenario leading up to a rape. It does not show the rape itself, but may be triggering to some people.Please take this into consideration before viewing the film.    \r\n\r\nInitiated and launched in Wellington, New Zealand, this ground-breaking multi-media campaign is a collaborative effort from T Pakari Ora  Sexual Assault Assessment and Treatment Service, Sexual Abuse Prevention Network, Wellington Sexual Health, Sexual Abuse HELP Foundation, Radio Network Wellington, Hutt Rape Counselling Network, Wellington Police, Doctors for Sexual Abuse Care and Regional Public Health.\r\n\r\nThe Who Are You? Toolkit  was developed and designed by the Who Are You? Steering Committee, comprised of:\r\n\r\nSexual Abuse Prevention Network, Wellington New Zealand\r\nWellington Sexual Health and Sexual Assault Services\r\nWellington HELP Foundation\r\nThe Radio Network, WellingtonWho Are You? is a free toolkit that uses group exercises and a short film to educate young people about the prevention of sexual violence and ethical sexual decision making.\r\nThe toolkit can be used by educators to facilitate group sessions that are fun and interactive, and build skills in children and young people. It is easy to use and can be adapted for different age groups or learning abilities.\r\n\r\nThis toolkit works well alongside health classes for year ten, or as part of citizenship, sexual health and anti-bullying curriculum. This is suitable for over 15s.\r\n\r\nhttp://www.whoareyou.co.nz\r\n\r\nIn New Zealand, it is estimated that 1 in 4 females and 1 in 8 males are likely to experience sexual violence or abuse in their lifetimes (NZ National Survey of Crime Victims, MoJ, 2004 and Fanslow, 2007). Offenders are most often known to the victim, and the events leading up to the assault are often witnessed by others. Sexual violence can often be prevented if someone does somethinghowever small.\r\n\r\nMost of us won't help if we are in an unsafe situation. But most of us arent sure how to step in and help others, even when its happening right in front of us.\r\n\r\nThe Who Are You campaign focuses on what each and every one of us can do to stop a possible sexual assault from happening.\r\n\r\nIt asks us all:\r\n\r\nWhat if we looked after each other?\r\nWhat if we became ethical bystanders?\r\nWhat if we took action that could help keep others safe?\r\nBeing an ethical bystander is all about doing little things, long before we get to the point of harm. Sexual violence can have an enormous impact on peoples lives  not just the victims, but their families, partners, and friends. This project asks us to consider Who am I and what would I do? It offers ideas about actions we can all take which will help keep everyone safe. \r\n\r\nIts not about being a hero or putting yourself at risk, but it is about preventing sexual violence.\r\n\r\nThe theme of this campaign and short film was informed by Professor Moira Carmodys (University of Western Sydney, Australia) research and the resulting Sex & Ethics: The sexual ethics education program for young people (2009) Palgrave Macmillan, Melbourne, which focuses on sexual violence prevention using ethical decision-making strategies and the concept of bystander intervention.", "keywords": "Sexual abuse rape", "duration": 486.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-01_50_49.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com