, where they opened up to YPFS and shared honest stories about their sexual experiences and concerns.   Explain why the method of promotion was most relevant to the product or service. The X-Ray Film Project became a hot conversation topic amongst teens all over Thailand. We used Facebook to start the conversation because Facebook is Thailands most influential medium for Thai teens. We then leveraged the strength of our Facebook campaign into a project enlisting real teenagers to star in original movies about the sexual issues of normal teens. By giving teenagers a chance to audition, and share their own stories, we positioned YPFS as a trustworthy organization that empowered young people to be honest about their private thoughts. We changed attitudes and gave teens a safe space to be heard.   Describe the success of the promotion with both client and consumer including some quantifiable results. Our 3 characters on Facebook became the center of an active social network of 24,000 teenagers. Over 13,000 teens auditioned for the X-Ray Film Project (providing valuable data to YPFS), and 24 were chosen to star in the movies. When the movies were released, 30,000 teens attended special screenings at YPFS service centres, and over 1.9m watched the films online. The popularity of the movies led Thai cable channels to screen them on TV, and they are now being used in Thai schools as sex education teaching tools. The number of visitors to YPFS service centers increased by 200%.   The Online Advert titled X-Ray Film Project was done by Leo Burnett Bangkok advertising agency for product: Department Of Disease Control (brand: Department Of Disease Control, The Ministry Of Public Health) in Thailand.", "keywords": "\"X Ray Film Project\"", "duration": 119.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-10_09_32.mp4", "post