fields": {"user": null, "vendor_id": 0, "title": "India-\"THE B-MOVIE STAR", "video": "uploads/VideoUpload/_15-Nov-21-11_37_11.mp4", "slug": "b-movie-starnonenonetrue-india-the", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_15-Nov-21-11_37_43.jpg", "desc": "RESULTS AND EFFECTIVENESS:\r\nIn the 6 weeks following the campaign, condom sales were 16% up in the areas near the movie theatres. Affection AIDS ran the campaign in 23 movie theatres in 8 towns. Encouraged by the response, our client has extended the campaign to cover 334 movie theatres in 79 towns across India.\r\nCREATIVE EXECUTION:\r\nWe grabbed the insight that people are interested in sex not sex education. That was our starting point. We zeroed in on the B-movie screen (Indian adult movies which conceal as much as they reveal) as the medium that would transmit our message. Working with B-movie producers, we inserted a video clip of a womans hand giving a condom pack to a mans hand, which subsequently opens it, into B-movies right before the sex act was shown. Thus, the condom became a necessary part of movie sex. The movie screen was the lead medium to propagate our message. Collateral media like posters and hand-outs helped hammer in the message further. A ripple effect of our campaign was that we found a free medium  the local press.\r\nINSIGHTS, STRATEGY, AND THE IDEA:\r\nOur client, Affection AIDS, wanted to take sex education to the Indian masses, particularly to the most vulnerable  the uneducated. Our audience was not likely to be attracted to sex education initiatives. They had a minimal, if any, interest in our brand. For people from the lower economic strata in India, sex is a subject thats discussed among friends or emulated from movie screens. The client wanted sex education, the audience wanted sex. We found the middle ground  the silver screen  where each could co-exist naturally and provide maximum impact.", "keywords": "AIDS India", "duration": 118.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-11_37_11.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_15-Nov-21-11_37_43.jpg", "created_at": "2021-11-15T06:07:43.799Z", "modified_at": "2021-11-15T11:08:23.432Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 278, "fields": {"user": null, "vendor_id": 0, "title": "India-\"YOUR TIME, YOUR PLACE", "video": "uploads/VideoUpload/_15-Nov-21-11_37_51.mp4", "slug": "time-india-your-your-placenonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_15-Nov-21-11_38_21.jpg", "desc": "Moods Condoms TV Advertisement.", "keywords": "Condoms", "duration": 45.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-11_37_51.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_15-Nov-21-11_38_21.jpg", "created_at": "2021-11-15T06:08:22.063Z", "modified_at": "2021-11-15T11:07:05.870Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 279, "fields": {"user": null, "vendor_id": 0, "title": "Israel-\"DOUBT\"", "video": "uploads/VideoUpload/_15-Nov-21-11_38_30.mp4", "slug": "israel-doubtnonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_15-Nov-21-11_38_58.jpg", "desc": "AIDS AWARENESS", "keywords": "condom use HIV prevention", "duration": 38.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_15-Nov-21-11_38_30.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_15-Nov-21-11_38_58.jpg", "created_at": "2021-11-15T06:08:59.387Z", 