1-01_44_38.mp4", "slug": "switzerland-love-lifenonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_17-Nov-21-01_45_03.jpg", "desc": "AIDS AWARENESS", "keywords": "AIDS AWARENESS", "duration": 31.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-01_44_38.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-01_45_03.jpg", "created_at": "2021-11-16T20:15:03.798Z", "modified_at": "2021-11-20T08:32:57.007Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 335, "fields": {"user": null, "vendor_id": 0, "title": "Switzerland-\"PAST\"", "video": "uploads/VideoUpload/_17-Nov-21-01_45_10.mp4", "slug": "switzerland-pastnonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_17-Nov-21-01_45_38.jpg", "desc": "AIDS AWARENESS", "keywords": "AIDS AWARENESS", "duration": 37.0, "record_date": "1 Dec 2005", "country": "Switzerland", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "SPILLMANN/FELSER/LEO", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-01_45_10.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-01_45_38.jpg", "created_at": "2021-11-16T20:15:39.051Z", "modified_at": "2021-11-21T18:44:53.989Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 336, "fields": {"user": null, "vendor_id": 0, "title": "Taiwan-\"Xerud the lover's fortuneteller", "video": "uploads/VideoUpload/_17-Nov-21-01_45_50.mp4", "slug": "fortunetellernonenonetrue-the-lovers-taiwan-xerud", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_17-Nov-21-01_46_22.jpg", "desc": "Taiwan category sales volume was in decline. To increase condom purchases we needed to remind our young audience of the risks of unprotected sex tasks effectively done in other markets via sampling. Given the cultural taboos in Taiwan, regular promoters in the streets were not being able to achieve the daily contact goals. We had to find a new and more effective way to get our products into the consumer's hands to start conversations. All Taiwanese generations frequently consult fortune-tellers to know their fate in wealth, health, and especially love. With a very limited budget, we created an unbranded fortune-teller machine called Xerud and placed it in bars, nightclubs, and karaoke bars where the inhibitions are lessened. Xerud handed out predictions related to ones sexual life and relationships together with the most relevant sample condom based on the forecast and the product benefit. The sample pack also contained educational tips about safe sex. On average a street promoter handed out 23 samples an hour while Xerud handed out an average of 77. Most importantly weve softened inhibitions and started meaningful conversations.", "keywords": "condoms", "duration": 140.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-01_45_50.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-01_46_22.jpg", "created_at": "2021-11-16T20:16:22.842Z", "modified_at": "2021-11-20T08:30:55.294Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 337, "fields": {"user": null, "vendor_id": 0, "title": "Thailand-\"SHARING SEX\"", "video": "uploads/VideoUpload/_17-Nov-21-01_46_30.mp4", "slug": "thailand-sharing-sexnonenonetrue", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_17-Nov-21-01_47_01.jpg", "desc": "The commercial titled Sharing Sex was done by Lowe Thailand advertising agency for STAYING-ALIVE.ORG (MTV company)", "keywords": "condoms", "duration": 64.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-01_46_30.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-01_47_01.jpg", "created_at": "2021-11-16T20:17:01.887Z", "modified_at": "2021-11-20T08:29:32.942Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 338, "fields": {"user": null, "vendor_id": 0, "title": "Thailand-\"X RAY FILM PROJECT\"", "video": "uploads/VideoUpload/_17-Nov-21-01_47_11.mp4", "slug": "ray-projectnonenonetrue-film-thailand-x", "video_cat": 1, "sub_cat": 1, "poster_image": "uploads/poster/_17-Nov-21-01_47_43.jpg", "desc": "Describe the objective of the promotion. Youth Friendly Services offer free consultations to young people in Thailand who want to talk about sexual issues in a confidential setting. But why would teenagers open up to a government organization about their most private thoughts? Sex is a difficult subject to talk about, so we needed to introduce ourselves to Thai teens, earn their trust, and encourage them to visit our centers to consult with us. The objective was to increase visits to YPFS centers and raise the profile of the organization amongst teens. Describe how the promotion developed from concept to implementation. To connect with teens, we created 3 Facebook characters publicly dealing with sexual issues that teens struggle with. They quickly gained thousands of friends, and their pages became forums for teens offering advice and opinions. We then revealed to their 24,000 Facebook friends that these status updates would be used as movie scripts, and we invited teens to audition for a starring role in 3 original movies about our characters. 13,000 teens came to our service centers and auditioned for parts in the movies, where they opened up to YPFS and shared honest stories about their sexual experiences and concerns. Explain why the method of promotion was most relevant to the product or service. The X-Ray Film Project became a hot conversation topic amongst teens all over Thailand. We used Facebook to start the conversation because Facebook is Thailands most influential medium for Thai teens. We then leveraged the strength of our Facebook campaign into a project enlisting real teenagers to star in original movies about the sexual issues of normal teens. By giving teenagers a chance to audition, and share their own stories, we positioned YPFS as a trustworthy organization that empowered young people to be honest about their private thoughts. We changed attitudes and gave teens a safe space to be heard. Describe the success of the promotion with both client and consumer including some quantifiable results. Our 3 characters on Facebook became the centre of an active social network of 24,000 teenagers. Over 13,000 teens auditioned for the X-Ray Film Project (providing valuable data to YPFS), and 24 were chosen to star in the movies. When the movies were released, 30,000 teens attended special screenings at YPFS service centers, and over 1.9m watched the films online. The popularity of the movies led Thai cable channels to screen them on TV, and they are now being used in Thai schools as sex education teaching tools. The number of visitors to YPFS service centres increased by 200%. The Online Advert titled X-Ray Film Project was done by Leo Burnett Bangkok advertising agency for product: Department Of Disease Control (brand: Department Of Disease Control, The Ministry Of Public Health) in Thailand. It was released in Jul 2012.", "keywords": "sex education teens", "duration": 119.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-01_47_11.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-01_47_43.jpg", "c