orms. With the tagline, There are many ways to do it. There is only one way to do it safely, DDB New Yorks campaign features an array of elder couples of the target 55+ demographic demonstrating a variety of Kama Sutra positions. \r\nRather than taking a negative approach that uses scare tactics and piles on statistics to deter unsafe sex, DDB made the strategic choice to use humor and shock value. However, it was important for us that our creative response felt empowering to the 55, 60, 65+ demographic. Whether the younger generation likes it or not, our grandparents are having sex. We wanted to make a sexy ad that maintains a level of tastefulness and encourages seniors to enjoy their sex lives safely.\r\n\r\nWhile the ad maintains a playful tone, the truth remains that shocking statistics have recently come to light showing that the rate of STDs among older Americans, including syphilis and gonorrhoea, has doubled in the last decade, and the rate of HIV infection is reaching similar levels. From 2005 to 2009, the number of cases of syphilis and Chlamydia in seniors in central Florida rose 71% and 62% in the entire state. \r\n\r\nSome experts hypothesize that this epidemic of STDs among senior citizens is a result of growing up in an age before sex education was the status quo. With DDB New Yorks rich history creating healthcare campaigns, we felt uniquely positioned to help ensure that a lack of education is not the reason this issue persists, and hope this campaign will help dispel stigmas around talking about safe sex practices for seniors.", "keywords": "Safe Sex for Seniors Public Service Announcement", "duration": 30.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-02_16_24.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-02_16_44.jpg", "created_at": "2021-11-16T