/uploads/VideoUpload/_17-Nov-21-08_06_34.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_07_33.jpg", "created_at": "2021-11-17T02:37:34.332Z", "modified_at": "2021-11-19T09:17:06.391Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 461, "fields": {"user": null, "vendor_id": 0, "title": "SENSATE FOCUS, Part Two", "video": "uploads/VideoUpload/_17-Nov-21-08_08_02.mp4", "slug": "focus-sensate-twononenonetrue-part", "video_cat": 3, "sub_cat": 52, "poster_image": "uploads/poster/_17-Nov-21-08_09_06.jpg", "desc": "Continues the process demonstrated in part one. In this film, each partner also teaches the other by means of direct physical guidance. The film emphasizes non-genital touching.", "keywords": "Sex therapy sensate focus sexual pleasure non-demand", "duration": 630.0, "record_date": null, "country": "USA", "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_08_02.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_09_06.jpg", "created_at": "2021-11-17T02:39:06.468Z", "modified_at": "2021-11-19T09:15:47.726Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 462, "fields": {"user": null, "vendor_id": 0, "title": "The Home Economics Story (Part I", "video": "uploads/VideoUpload/_17-Nov-21-08_09_44.mp4", "slug": "home-story-economics-the-part-inonenonetrue", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_10_54.jpg", "desc": "A high school girl's interest in home economics becomes a way for her to legitimize her desire to attend college. It's easy to ridicule these films, but underneath all their corny imagery we can see how hard it was for girls to have any real educational opportunities after high school. At the time this film was made, many parents didn't see the need for their daughters to attend college. Would Kay, the girl in this film, be allowed to go to college at all if she wasn't majoring in Home Economics? Probably not. I particularly liked the scenes with Kay and her parents poring over the college application. Kay could be the first in her family to go to college and the voice-over reminds us, College for Kay would mean sacrifices for Mom and Dad. Would it be worth the sacrifice? When Kay's college acceptance letter comes in the mail, her mother, humbly wiping her hands on her apron, is standing at her side. Kay has a chance for a larger life that her mother was denied.", "keywords": "Gender roles Home economics Colleges and universities", "duration": 748.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_09_44.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_10_54.jpg", "created_at": "2021-11-17T02:40:55.035Z", "modified_at": "2021-11-19T09:14:33.950Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 463, "fields": {"user": null, "vendor_id": 0, "title": "The Home Economics Story (Part II", "video": "uploads/VideoUpload/_17-Nov-21-08_11_27.mp4", "slug": "the-part-home-story-iinonenonetrue-economics", "video_cat": 2, "sub_cat": 38, "poster_image": "uploads/poster/_17-Nov-21-08_12_42.jpg", "desc": "This idealized story of four years in the life of Kay, Jean, Helen, and Louise evokes the lost world of Iowa State's Home Economics Division in the fifties. When an assembly speaker at the high school talks of girls who studied home economics in college, Kay is smitten. But it is a big thing for someone in her family to attend college. She convinces her parents to make the sacrifice and is so eager to leave that she is packing her bags just minutes after receiving her acceptance letter. There is more than a hint here that she wants something more than her family or high school can ordinarily offer. \"What is home economics?\" the narrator asks, hinting at the field's complexity: it is an interdisciplinary field that unites the arts and sciences with traditionally female activities, thus feminizing many otherwise neutral activities. In-home economics, physics classes teach toaster-testing, and women chemists study the interaction of tomato soup and milk. Says the narrator: \"All the classes seemed to fit together. Even the physics class was what a girl would like. It was about physics in the home. This course helped you to understand just what makes things run. Then, in household equipment, you could study the practical side: the use of an appliance. In turn, there were courses in foods and nutrition where you learned the why as well as the how.\" As a discipline, home economics looks both forward and backward. Although it enables women to leave the home and play essential roles in institutions, corporations, and schools (\"She could see herself at the center of a world made up of large ovens and mixers manned by professional cooks\"), home economists' work, seen as \"women's work,\" has not been valued as highly as less essential work that happens to be performed by men. Even the professionalization of the home economics sphere has not kept its activities from being taken for granted. Historically connected to social movements like progressivism, to the empowering of women and immigrants, and to activism in the service of public health, home economics has a socially active side as well. Although The Home Economics Story expresses all of these (except social activism), the film emphasizes over and over that, most important of all, the training enables women to take care of their families and children. \"Each girl has been preparing for two careers. One her chosen specialty, the other is acareer in homemaking.\" The students are not allowed to forget that they will be women first and home economists second. Kay fantasizes about herself as a wife putting her training into practice at home. And there is a pitch for a traditionally female focus on emotions and psychology rather than on the material world: \"The girls learn a lot from the children of the nursery school . . . how habits and attitudes learned at this stage are so important in later life. They learn how much depends on getting along with others . . . for, after all, we live in a world where people are more important than things.\"The Home Economics Story is also a great evocation of fifties college life, rich in culture and prescribed rituals; interestingly enough, at least in the home ec division, it is a world made up almost exclusively of women. Although a few football players and a prom date or two come and go, these four girls and their classmates spend four years together; their last year they even live together in the Home Management house. Louise has \"the most envied task\"-taking care of a baby. This is a free space for women to learn among themselves, single-sex education at its most rarefied-at least until Beth first sports her wedding ring. Iowa State College's Film Production Unit made many films relating to home economics, including Yarn About a Kitchen (1955), a time-and-motion study of meal preparation, in which the woman's movements are marked by a three-dimensional trail of yarn throughout the kitchen. As a university production, The Home Economics Story is fascinating to watch and compare with other education.", "keywords": "Gender roles Home economics Colleges and universities", "duration": 752.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_11_27.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_12_42.jpg", "created_at": "2021-11-17T02:42:43.231Z", "modified_at": "2021-11-19T09:13:31.436Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 464, "fields": {"user": null, "vendor_id": 0, "title": "Social-Sex Attitudes in Adolescence", "video": "uploads/VideoUpload/_17-Nov-21-08_13_37.mp4", "slug": "attitudes-adolescencenonenonetrue-in-social-sex", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_15_36.jpg", "desc": "Social-sex development of Bill and Mary and how they came to meet, fall in love and marry.", "keywords": "Sex education  Social guidance Gender roles", "duration": 1377.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_13_37.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_15_36.jpg", "created_at": "2021-11-17T02:45:37.117Z", "modified_at": "2021-11-19T09:10:58.986Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 465, "fields": {"user": null, "vendor_id": 0, "title": "Are You Popular?", "video": "uploads/VideoUpload/_17-Nov-21-08_16_06.mp4", "slug": "are-popularnonenonetrue-you", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_17_06.jpg", "desc": "One of the best examples of post-World War II social guidance films, with examples of \"good\" and \"bad\" girls, proper and improper dating etiquette, courtesy to parents, and an analysis of what makes some people popular and others not. A scream and a sobering document of postwar conformity.", "keywords": "Social guidance Teenagers Gender roles Dating", "duration": 592.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_16_06.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_17_06.jpg", "created_at": "2021-11-17T02:47:06.761Z", "modified_at": "2021-11-19T09:09:57.220Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 466, "fields": {"user": null, "vendor_id": 0, "title": "Are you ready for Marriage", "video": "uploads/VideoUpload/_17-Nov-21-08_17_44.mp4", "slug": "you-ready-marriagenonenonetrue-are-for", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_19_12.jpg", "desc": "Courtesy of Prelinger Archives\r\nAre You Ready for Marriage? was produced to stem the epidemic of youthful, impetuous, and unsuccessful marriages following World War II. The Coronet catalog entry for the film reads: A very young couple have just about decided to elope since the girls parents object to the marriage. However, they first decide to talk over their problem with the marriage counselor at the church. During this talk, they find that they really don't know too much about each other, and the counselor suggests that they should ask themselves some questions before getting too serious. Questions like do they have similar backgrounds?, are they real friends?, and do they understand marriage? He also stresses that when people are ready for marriage, they sense a new feeling between them-a feeling of paired unity. In conversation, I changes to we. \r\n\r\nThe film begins with a long, slow kiss on the porch, an unusually intimate moment for an educational film. Things rapidly change, though, when Sues parents forbid her engagement to Larry. Led by Mr. Hall, the minister/counselor, Sue a Larry quickly learn that theres more to marriage than mere sexual attraction-boing! Mr. Hall uses the Marriage Development board, an awkward but compelling visual aid featuring little dolls linked by rubber bands, to illustrate the concepts of psychological distance and emotional makeup. Fascinating graphs emerge from the edges of this apparatus illustrating marital success as it relates to age before marriage and length of engagement. Cupids checklist, which in one form or another shows up in most American premarital training literature, asks whether the couple comes from similar backgrounds, whether they are real friends, and whether they understand marriage. The temptation for us to rate ourselves on these scales, even if we fail, is irresistible.\r\n\r\nTime hasn't been friendly to this film, but its out-datedness makes it amusing and fascinating to watch. The teenage actors squirm and whine in their unrealizable passion, and Mr. Hall lectures them at some length. There is a great deal of talk in this film, probably because it strove to bring sex- and love-crazed teenagers back into the grown-up, logocentric world of reason, and Mr. Hall pursues the praiseworthy goal of getting Sue and Larry to talk about things that matter. No difference of opinion? he asks. Or no opinion? With little subtlety, the film also raises the issue of correct gender roles. Its all one way or another, as Sue explains: But I don't want a girl  I want a man, like Larry. The ending is happy. Sue and Larry, engaged to be engaged, realize they now have more than boing going for them.\r\n\r\nTheres a wealth of good advice in Are You Ready for Marriage?, but it seems pitifully naive next to training films for slightly older people (This Charming Couple and Whos Boss, for instance, focus on the arbitration of power relations in marriage). Aside from Sues parents insistence that she get at least some college education, Are You Ready for Marriage? does not anticipate much of the heavy stuff that serious couples inevitably experience, perhaps in order not to frighten teens away from marriage altogether. Yet, by stressing resolution of key issues prior to marriage and ignoring those that emerge later on, the film suggests that social contradictions somehow dissolve on wedding day. And of course, there is no real consideration of how society dictates different roles for men and women within the confines of matrimony.\r\n\r\nAre You Ready for Marriage? manages to be simultaneously touching and annoying. It is a film about acceptance and submission. Sue and Larry learn on their own to accept societys conventional wisdom. No one could accuse the authorities behind films like these of serving their own interests-the films really were for the good of the children. But even if the advice is correct, does the survival of our culture require children to accept the dictates of their counselors and parents with so little imagination? We survived the sixties, when all rules seemed up for grabs, but have we truly gotten the fifties, with its complexes of obedience and its deference to authority, out of our systems?\r\n\r\nFrom Educational Screen, September 1950: The evaluating group felt that the film should be very effective on the high school level both in group and individual counseling. In addition to its effectiveness in high school guidance situations, the film should also be useful in extra-school young peoples organizations, as well as teacher and parent study groups. The producers are to be complimented on creating an atmosphere of life-like situations. The film skillfully avoids stereotyped characters, stale and trite expressions, and unnaturalness.\"", "keywords": "social guidance marriage Gender roles", "duration": 962.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_17_44.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_19_12.jpg", "created_at": "2021-11-17T02:49:12.878Z", "modified_at": "2021-11-19T09:08:23.630Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 467, "fields": {"user": null, "vendor_id": 0, "title": "Is This Love?", "video": "uploads/VideoUpload/_17-Nov-21-08_19_48.mp4", "slug": "lovenonenonetrue-this-is", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_21_18.jpg", "desc": "Two couples are getting married - one couple rushes to tie the knot, while the other's courtship lasts a lot longer. The two relationships are compared.\r\n\r\nCourtesy of The Prelinger Archive", "keywords": "Social Guidance Marriage Gender Roles", "duration": 878.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_19_48.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_21_18.jpg", "created_at": "2021-11-17T02:51:18.934Z", "modified_at": "2021-11-19T09:07:09.862Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 468, "fields": {"user": null, "vendor_id": 0, "title": "Cindy Goes to a Part", "video": "uploads/VideoUpload/_17-Nov-21-08_21_42.mp4", "slug": "cindy-a-partnonenonetrue-to-goes", "video_cat": 1, "sub_cat": 22, "poster_image": "uploads/poster/_17-Nov-21-08_22_41.jpg", "desc": "Courtesy of Prelinger Archives\r\nCinderella resurfaced in Lawrence, Kansas, in 1955, this time as Cindy, a bit of a tomboy who is decidedly unsure of her social status. Her vexing problem: some of the kids at school are having a birthday party, and she hasn't gotten an invitation. Falling asleep, Cindy wakes and is greeted by a young woman in formal dress identifying herself as her fairy godmother, who transports her and friend Dennis (who needs some education in manners) to the party. While the other partygoers, quite unaware of the intense training happening around them, play games and consume refreshments, the fairy godmother sets up a series of didactic demonstrations of proper party behavior for Cindy and Dennis. Liberal use is made of the magic wand, superimposed titles (\"Don't break things\" and \"Leave on time\"), and minor cinema trickery. When Cindy wakes, the invitation is in her mother's hands and she really is going to the party. But she's changed, like so many dreamers in educational films. No longer a tomboy, she is growing into a \"good girl.\"Educational and training films are full of dreams, an ideal vehicle to enable the imagination of scriptwriters. Troubled protagonists fall asleep and are visited by supernatural figures with special expertise and knowledge. Although few mid-century educational films ever explicitly counseled children on the acceptance of proper gender roles, a good many of them contain strong implicit messages to this effect. For Cindy, gravitating away from a mixed-gender identification to full-blown \"girliness\" is presented as a necessity and as an answer to her expressed the need to \"fit in.\" This is the way it came down in 1955, and not enough has changed. As scriptwriter Trudy Travis reveals in her interview (on the Make Mine Freedom disc), Centron shot most of its productions in and around Lawrence, using nonprofessional talent from the nearby University of Kansas and elsewhere. Their films collectively form an unusually interesting record of the \"look and feel\" of Lawrence and the surrounding area throughout the postwar years. While Centron, like other producers, generally avoided explicit regional references, it made no attempt to homogenize the distinctive speech and mannerisms of its prairie-reared talent and, perhaps without intending to, create movies that have real ethnographic and documentary value quite aside from their declared subject matter.", "keywords": "Gender roles Social guidance Etiquette Recreation", "duration": 560.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-08_21_42.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-08_22_41.jpg", "created_at": "2021-11-17T02:52:42.047Z", "mo