Trailer: How Do I Look", "video": "uploads/VideoUpload/_17-Nov-21-09_43_29.mp4", "slug": "trailer-looknonenonetrue-how-i-do", "video_cat": 1, "sub_cat": 4, "poster_image": "uploads/poster/_17-Nov-21-09_44_28.jpg", "desc": "The How Do I Look documentary was created by artistic and social activist Wolfgang Busch for Art From The Heart LLC, over a period of 10 years, to empower the Ball community artistically and financially and to build a national artistic infrastructure to further the careers of LGBT artists.\r\n\r\nHow Do I Look is LGBT artistic empowerment, HIV/AIDS awareness community project, and art in education program, focusing on the members of the national Ball community that took their talents outside the Ball scene and worked with superstars such as Queen Latifa, Madonna, India and fashion designer Thierry Mugler to name a few.\r\nHow Do I Look captured the Ball communities talents, the assets of this very creative and trend-setting community, and takes you inside of this over 35-year-old Harlem tradition?\r\nHow Do I Look highlights the legends and icons lifestyles, their house system and family values, their everyday struggles, the fierce fashion, the dance vogue old way vs. new way and runway competition, the passing of three generations of ballroom traditions, transgender health issues, and education, HOPE messages on the battle with HIV/AIDS, and how they build their confidence, self-esteem, and ballroom status through the performance art.\r\nThe outstanding fashion, runway, and voguing visuals in this documentary are the result of this improvisational performance art form and the natural artistic progression. It was captured by German/American activist and filmmaker Wolfgang Busch through an artistic lens, while showcasing their talents in different categories on the runway, battling for that perfect 10 from the judges for ballroom status, recognition, cash, and trophies, to become legendary and to be voted into the Ballroom Hall of Fame one day.\r\n\r\nBased on their gender, every house member can participate and has the opportunity to bring their fantasy to reality on the runway, living that superstar moment, most of them can not experience anywhere else. Lifetime achiever and Ballroom Hall of Famer Kevin Omni and mother of the year 2004 Luna Khan are assistant directors and Marcel Christian, Alvernian Prestige, Mann Prodigy, Ricky Revlon, Derryck Labeija, CoolAid, and Jack Mizrahi give us the Ballroom history. Legendary Icon Pepper Labeija, one of the founders of the Harlem Ball scene from the sixties, is being honored by the community for his leadership and for his endless contributions.\r\n\r\nHDIL captures the unique talents of futuristic bazaar fashion designers Ross Infiniti and RR Chanel International, along with the voguing talents of Willi Ninja, Jose Xtravaganza, Mecca, Muhammad Omni, and Andre Mizrahi who keep the history and the legacy alive for future generations to enjoy. The powerful transgender community is represented by Octavia St. Laurent, Carmen Xtravaganza, Tracy Africa, Alyssa St. Clair, and Jazmine Givenchy Blahnik. They speak about their diverse lifestyles such as graduating from Syracuse University, modeling & performance careers, and the stages of transformation of becoming a transgender. Octavias farther Billy Austin tells us to love our children as they are. Luna Luis Ortiz, Mother of the House of Khan leaves the children with a message of HOPE by sharing his story about how he became infected with the HIV virus during his first sexual experience at the age of 14; and how he continues to live a full life at the age of 33, using his photography skills as a teacher at the Harvey Milk High School. Harmonica Sunbeam speaks of the importance of protecting yourself against HIV at all times. Jaimee Balenciaga voted mother of the year for 7 years in a row, is a lesbian talking about how she educates her house children and prepares them for the competition on and off the runway.\r\n\r\nPoems are by Emanuel Xavier called Legends and by Octavia St. Laurent the Chosen One.\r\n\r\nThe music is provided by the local community, Tori Fixx from Chicago, DJ PUNCH from Atlanta, Deadlee from Los Angeles, Michael O ", "keywords": "How Do I Look, Paris is Burning Wolfgang Busch vogue runway drag harlem willi ninja jose xtravaganza", "duration": 615.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-09_43_29.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-09_44_28.jpg", "created_at": "2021-11-17T04:14:28.515Z", "modified_at": "2021-11-19T06:53:51.938Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 513, "fields": {"user": null, "vendor_id": 0, "title": "Get Tested", "video": "uploads/VideoUpload/_17-Nov-21-09_44_34.mp4", "slug": "get-testednonenonetrue", "video_cat": 2, "sub_cat": 39, "poster_image": "uploads/poster/_17-Nov-21-09_44_46.jpg", "desc": "AIDS PREVENTION PSA", "keywords": "AIDS PREVENTION STD", "duration": 19.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-09_44_34.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov-21-09_44_46.jpg", "created_at": "2021-11-17T04:14:47.229Z", "modified_at": "2021-11-19T06:43:28.769Z", "active": true, "home_active": true}}, {"model": "ssf.videoupload", "pk": 514, "fields": {"user": null, "vendor_id": 0, "title": "Sensate Focus Exercise #7 A Gay Couples' Guide to Sexual Pleasure: INTERCOURSE", "video": "uploads/VideoUpload/_17-Nov-21-09_45_25.mp4", "slug": "sensate-focus-guide-to-pleasure-couples-intercoursenonenonetrue-a-exercise-sexual-gay-7", "video_cat": 3, "sub_cat": 48, "poster_image": "uploads/poster/_17