eed, and various blogs. The above viral success earned us two weeks of free advertising air-time the nation's largest TV network MTV3 and four consecutive print releases of the idea on the nation's largest lifestyle magazine IMAGE. We're now among the top results when Googling with the most popular search terms, sex and Facebook (image search). \"The AIDS Council of Finland draws you in with sex, and then jars you using Facebook 'Places\" as a creative linchpin (Penis-pin? Sorry). The spots are quite effective\" - Newsweek \"AIDS Council PSAs Use Foursquare Reference Brilliantly To Sell Safe Sex\" - Huffington Post   Execution   We made two beautiful and distinctive films, that draw you in with sex, and then jars you using Facebook Check-In image as a creative linchpin.   The Situation   The HIV Foundation doesn't have too much (almost any at all) money to spread its important safe sex message. So we had to do something that would spread itself.   The Strategy   We knew that awareness is raised and the target group is best reached via social media. So we chose a viral video -approach. We assumed that when constructing a message for the young and sexually care-free first-world audience to relate to, we should. - adapt the visual incentive/modus operandi from the medium itself - create first wave discourse by seemingly 'objectifying' women - further influence achieved conversation by 'objectifying' men also - still expand the conversation by making the man 'sluttier'   The Case study titled FACEBOOK IN YOUR PANTS was done by McCann Helsinki advertising agency for brand: Finnish Aids Council in Finland. It was released in May 2013.", "keywords": "Condoms", "duration": 151.0, "record_date": null, "country": null, "hit_count": 0, "rated_by": 0, "rating": 0.0, "producer": "", "director": "", "video_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/VideoUpload/_17-Nov-21-11_04_02.mp4", "poster_url": "https://s3.us-east-1.amazonaws.com/new-ssf/uploads/poster/_17-Nov